import './sidebar.css'
import avt from '../../../img/avt.jpg';
import Item from './item';
import { faHouse, faMessage } from '@fortawesome/free-solid-svg-icons'

<FontAwesomeIcon icon={faMessage} />
function Sidebar() {
    return (
        <div className="sidebar">
            <div className="circle-container">
                <img src={avt} alt="" className="circle-image"></img>
            </div>
            <label>Name</label>
            <Item 
                icon= {faHouse}
                title= "PROPERTIES"
            />
            <Item 
                icon= {faHouse}
                title= "CHAT"
            />
            <Item 
                icon= {faHouse}
                title= "CALENDER"
            />
            <Item 
                icon= {faHouse}
                title= "OFFERS"
            />
            <Item 
                icon= {faHouse}
                title= "DOCUMENTS"
            />
            <Item 
                icon= {faHouse}
                title= "SETTINGS"
            />
        </div>
    );
}

export default Sidebar;
